import React from 'react';

export default class GoogleAuth extends React.Component {

  componentDidMount() {
    window.gapi.load('client:auth2', () => {
      window.gapi.client.init({
       clientId: '963311678002-lg1l4hlp9aiuk8tmse9lcs8q6qnvulti.apps.googleusercontent.com',
       scope: 'email'
      })
    });
  }

  render() {
    return (
      <div>Google Auth</div>
    );
  }
}
